import React, { useState, useEffect } from 'react';
import { Play, Pause, SkipBack, SkipForward, Shuffle, RepeatIcon } from 'lucide-react';

const MusicPlayer = () => {
  const [playbackState, setPlaybackState] = useState({
    track: '',
    artist: '',
    album_url: '',
    is_playing: false,
    progress_ms: 0,
    duration_ms: 0
  });
  const [handStatus, setHandStatus] = useState('inactive');

  useEffect(() => {
    const fetchPlayback = async () => {
      try {
        const response = await fetch('http://localhost:5001/api/playback');
        const data = await response.json();
        if (!data.error) {
          setPlaybackState(data);
        }
      } catch (error) {
        console.error('Error fetching playback:', error);
      }
    };

    const fetchHandStatus = async () => {
      try {
        const response = await fetch('http://localhost:5001/api/status');
        const data = await response.json();
        if (!data.error) {
          setHandStatus(data.hand_status);
        }
      } catch (error) {
        console.error('Error fetching hand status:', error);
      }
    };

    fetchPlayback();
    fetchHandStatus();

    const playbackInterval = setInterval(fetchPlayback, 1000);
    const statusInterval = setInterval(fetchHandStatus, 100);

    return () => {
      clearInterval(playbackInterval);
      clearInterval(statusInterval);
    };
  }, []);

  const formatTime = (ms) => {
    const seconds = Math.floor(ms / 1000);
    const minutes = Math.floor(seconds / 60);
    const remainingSeconds = seconds % 60;
    return `${minutes}:${remainingSeconds.toString().padStart(2, '0')}`;
  };

  return (
    <div className="min-h-screen bg-black text-white">
      {/* Main player section */}
      <div className="p-6">
        <div className="flex items-center gap-4">
          {/* Album art */}
          <img 
            src={playbackState.album_url || '/api/placeholder/400/400'} 
            alt="Album Cover" 
            className="w-16 h-16 rounded"
          />

          {/* Track info */}
          <div className="flex-1">
            <h2 className="text-sm font-medium">{playbackState.track || 'No track playing'}</h2>
            <p className="text-xs text-zinc-400">{playbackState.artist || 'Unknown artist'}</p>
          </div>

          {/* Controls */}
          <div className="flex items-center gap-4">
            <Shuffle className="w-4 h-4 text-zinc-400" />
            <SkipBack className="w-5 h-5 text-zinc-400" />
            <button className="w-8 h-8 bg-white rounded-full flex items-center justify-center">
              {playbackState.is_playing ? (
                <Pause className="w-4 h-4 text-black" />
              ) : (
                <Play className="w-4 h-4 text-black ml-0.5" />
              )}
            </button>
            <SkipForward className="w-5 h-5 text-zinc-400" />
            <RepeatIcon className="w-4 h-4 text-zinc-400" />
          </div>
        </div>

        {/* Progress bar */}
        <div className="mt-2">
          <div className="flex items-center gap-2">
            <span className="text-xs text-zinc-400 w-10">
              {formatTime(playbackState.progress_ms)}
            </span>
            <div className="flex-1 h-1 bg-zinc-800 rounded-full">
              <div 
                className="h-full bg-white rounded-full"
                style={{ width: `${(playbackState.progress_ms / playbackState.duration_ms) * 100}%` }}
              />
            </div>
            <span className="text-xs text-zinc-400 w-10">
              {formatTime(playbackState.duration_ms)}
            </span>
          </div>
        </div>
      </div>

      {/* Hand status indicator */}
      <div className="fixed bottom-6 left-1/2 -translate-x-1/2 bg-zinc-900/90 backdrop-blur px-4 py-2 rounded-full border border-zinc-800">
        <div className="flex items-center gap-2">
          <div className={`w-2 h-2 rounded-full ${
            handStatus === 'active' ? 'bg-green-500' :
            handStatus === 'warning' ? 'bg-yellow-500' :
            'bg-red-500'
          }`} />
          <span className="text-xs text-zinc-300">
            {handStatus === 'active' ? 'Hand Detected' :
             handStatus === 'warning' ? 'Hand at Edge' :
             'No Hand Detected'}
          </span>
        </div>
      </div>
    </div>
  );
};

export default MusicPlayer;
